  false,\n\t\"url\": null,\n\t\"notes\": \"Twelve quadrats were sampled along 2 consecutively-placed,
  25m transect lines, as part of Rapid Ecological Assessments, conducted at 9 sites
  at Kure Atoll in the NW Hawaiian Islands from 1 September - 4 October 2006, aboard
  the NOAA ship Hi'ialakai, during the Reef Assessment and Monitoring Program (RAMP)
  Cruise HI0611. Raw survey data included genus presence and relative abundance, and
  voucher specimens. Detailed taxonomic analyses of voucher specimens are presented.\",\n\t\"license_title\":
